import React from "react";
import { Layout, styles } from "../layout";
import CustomSocialBar from "./components/socialbar";

const Sitemap: React.FC = () => {
  const siteLinks = [
    { title: "Resume", path: "/resume" },
    { title: "About", path: "/about" },
    { title: "Video", path: "/video" },
    { title: "Blogs", path: "/blogs" },
    { title: "Writing", path: "/writing" },
    {
      title: "Projects",
      path: "/projects",
      subItems: [
        { title: "IRA Stocks", path: "/projects/ira-stocks" },
        { title: "Carbon Calc", path: "/projects/carbon-calc" },
        { title: "75 hard", path: "/projects/75-hard" },
        { title: "Wakeup Log", path: "/projects/wakeup-log" },
      ],
    },
  ];

  return (
    <div className="mt-8">
      <h2 style={styles.subHeader}>Check out the Site</h2>
      <ul style={styles.list}>
        {siteLinks.map((link, index) => (
          <li key={index} style={styles.listItem}>
            <a href={link.path} style={styles.link}>
              {link.title}
            </a>
            {link.subItems && (
              <ul style={{ ...styles.list, marginLeft: "40px" }}>
                {link.subItems.map((subItem, subIndex) => (
                  <li key={subIndex} style={styles.listItem}>
                    <a href={subItem.path} style={styles.link}>
                      {subItem.title}
                    </a>
                  </li>
                ))}
              </ul>
            )}
          </li>
        ))}
      </ul>
    </div>
  );
};

const HomePage: React.FC = () => {
  return (
    <Layout title="Jack Pearson">
      <h1 style={styles.header}>Welcome to My Website</h1>
      <p style={styles.paragraph}>
        Hi, I'm Jack Pearson, a finance major and aspiring developer. This
        website hosts some of my projects and helps me develop my web
        development skills. Stay tuned as I add more!
      </p>

      <h2 style={styles.subHeader}>Site Development üõ†Ô∏è</h2>
      <div
        style={{
          backgroundColor: "#f0f0f0",
          border: "1px solid #ddd",
          borderRadius: "4px",
          padding: "10px",
          marginBottom: "20px",
        }}
      >
        <strong>Note:</strong> This site is still in development and constantly
        being updated!
      </div>
      <p style={styles.paragraph}>
        This site is still pre-launch, and I haven't linked it to any public
        profiles yet. I'm constantly adding updates and new features!
      </p>

      <CustomSocialBar />
      <Sitemap />
    </Layout>
  );
};

export default HomePage;
